// src/services/api.js
import axios from 'axios';

// Configuração base do axios
const api = axios.create({
  baseURL: 'http://localhost:3001',
});

// Interceptor para adicionar token no header Authorization
api.interceptors.request.use((config) => {
  const token = localStorage.getItem('token');
  if (token) {
    config.headers.Authorization = `Bearer ${token}`;
  }
  return config;
});

// Interceptor para tratar respostas 401 (não autorizado)
api.interceptors.response.use(
  (response) => response,
  (error) => {
    if (error.response?.status === 401) {
      localStorage.removeItem('token');
      localStorage.removeItem('user');
      window.location.href = '/login';
    }
    return Promise.reject(error);
  }
);

// -------- Funções para Usuário (cliente) --------

export const updateUserProfile = async (userData) => {
  try {
    const response = await api.put('/api/usuarios/perfil', userData);
    return response.data;
  } catch (error) {
    throw error.response?.data || { mensagem: 'Erro ao atualizar perfil' };
  }
};

export const getVehicles = (filters = {}) => {
  const { marca, precoMin, precoMax, combustivel, includePromotions } = filters;
  return api.get('/api/veiculos', {
    params: { marca, precoMin, precoMax, combustivel, includePromotions },
  }).catch((error) => {
    throw error.response?.data || { mensagem: 'Erro ao buscar veículos' };
  });
};

export const getReservations = () => {
  return api.get('/api/reservas').catch((error) => {
    throw error.response?.data || { mensagem: 'Erro ao buscar reservas' };
  });
};

export const createReservation = (veiculo_id) => {
  return api
    .post('/api/reservas', { veiculo_id })
    .catch((error) => {
      throw error.response?.data || { mensagem: 'Erro ao criar reserva' };
    });
};

export const cancelReservation = (reserva_id) => {
  return api
    .delete(`/api/reservas/${reserva_id}`)
    .catch((error) => {
      throw error.response?.data || { mensagem: 'Erro ao cancelar reserva' };
    });
};

export const getNotifications = () => {
  return api.get('/api/notificacoes').catch((error) => {
    throw error.response?.data || { mensagem: 'Erro ao buscar notificações' };
  });
};

export const markNotificationAsRead = (notificacao_id) => {
  return api
    .put(`/api/notificacoes/${notificacao_id}/lida`)
    .catch((error) => {
      throw error.response?.data || { mensagem: 'Erro ao marcar notificação como lida' };
    });
};

export const getPromocoes = () => {
  return api.get('/api/promocoes').catch((error) => {
    throw error.response?.data || { mensagem: 'Erro ao buscar promoções' };
  });
};

// -------- Funções para Admin --------

export const adminApi = {
  listarVeiculos: () => {
    return api.get('/api/veiculos').catch((error) => {
      throw error.response?.data || { mensagem: 'Erro ao listar veículos' };
    });
  },

  adicionarVeiculo: (veiculoData) => {
    return api
      .post('/api/veiculos', veiculoData)
      .catch((error) => {
        throw error.response?.data || { mensagem: 'Erro ao adicionar veículo' };
      });
  },

  atualizarVeiculo: (id, veiculoData) => {
    return api
      .put(`/api/veiculos/${id}`, veiculoData)
      .catch((error) => {
        throw error.response?.data || { mensagem: 'Erro ao atualizar veículo' };
      });
  },

  excluirVeiculo: (id) => {
    return api
      .delete(`/api/veiculos/${id}`)
      .catch((error) => {
        throw error.response?.data || { mensagem: 'Erro ao excluir veículo' };
      });
  },

  entradaEstoque: (id, quantidade) => {
    return api
      .patch(`/api/veiculos/${id}/entrada`, { quantidade })
      .catch((error) => {
        throw error.response?.data || { mensagem: 'Erro ao registrar entrada no estoque' };
      });
  },

  saidaEstoque: (id, quantidade) => {
    return api
      .patch(`/api/veiculos/${id}/saida`, { quantidade })
      .catch((error) => {
        throw error.response?.data || { mensagem: 'Erro ao registrar saída do estoque' };
      });
  },

  listarUsuarios: () => {
    return api.get('/api/usuarios').catch((error) => {
      throw error.response?.data || { mensagem: 'Erro ao listar usuários' };
    });
  },

  atualizarDadosPessoais: (id, data) => {
    return api
      .put(`/api/usuarios/${id}`, data)
      .catch((error) => {
        throw error.response?.data || { mensagem: 'Erro ao atualizar dados pessoais' };
      });
  },

  excluirUsuario: (id) => {
    return api
      .delete(`/api/usuarios/${id}`)
      .catch((error) => {
        throw error.response?.data || { mensagem: 'Erro ao excluir usuário' };
      });
  },

  listarPromocoes: () => {
    return api.get('/api/promocoes').catch((error) => {
      throw error.response?.data || { mensagem: 'Erro ao listar promoções' };
      });
  },

  criarPromocao: (promocaoData) => {
    return api
      .post('/api/promocoes', promocaoData)
      .catch((error) => {
        throw error.response?.data || { mensagem: 'Erro ao criar promoção' };
      });
  },

  atualizarPromocao: (id, promocaoData) => {
    return api
      .put(`/api/promocoes/${id}`, promocaoData)
      .catch((error) => {
        throw error.response?.data || { mensagem: 'Erro ao atualizar promoção' };
      });
  },

  deletarPromocao: (id) => {
    return api
      .delete(`/api/promocoes/${id}`)
      .catch((error) => {
        throw error.response?.data || { mensagem: 'Erro ao deletar promoção' };
      });
  },

  obterPromocaoPorId: (id) => {
    return api.get(`/api/promocoes/${id}`).catch((error) => {
      throw error.response?.data || { mensagem: 'Erro ao buscar promoção' };
    });
  },

  listarRelatorios: () => {
    return api.get('/api/relatorios').catch((error) => {
      throw error.response?.data || { mensagem: 'Erro ao listar relatórios' };
    });
  },
};

export default api;
